The gets() function is used to read a string.
char a[100];
gets(a);
printf("You entered: %s", a);
scanf() scans input and convert input that matches format specifiers.
  int a;
  scanf("%d. ", &a);
  Input: 12.3.
  printf("You entered: %d", a);
